import EventDetail from './views/EventDetail'; // Add this import

const App = () => {
  return (
    <Router>
      <Switch>
        <Route component={Home} exact path="/" />
        <Route component={Events} exact path="/events" />
        <Route component={EventDetail} exact path="/events/:id" /> {/* Add this route */}
        <Route component={NotFound1} exact path="/not-found" />
        <Route component={NotFound1} path="**" />
        <Redirect to="**" />
      </Switch>
    </Router>
  );
};
